    return (
      <div class="container">
        <div class="card">
          <div class="back">
            <h1>
              Rajath Shetty
              <h3>Front end developer</h3>
            </h1>
            <ul>
              <li>+91-8277740694</li>
              <li>rajathshetty00@gmail.com</li>
              <li>www.linkedin.com</li>
            </ul>
          </div>
        </div>
      </div>
    );
  }
}

export default Contact;
